import { Card, CardBody, CardTitle } from 'reactstrap'
 export default function UpdateCourses({course}) {
   return (
   <>
  <Card className='text-center'>
    <CardBody> 
    <CardTitle className="font-weight-bold">{course.id}.{course.title}</CardTitle>
    </CardBody>
  </Card>
   </>
   )
 }
